  const [blogs, setBlogs] = useState([{h}])
  return (
    <>
    <SiteHeader />
    {
      blogs.map(getBlogs, (blog)=>{
        return <Blog heading={blog.heading} />
      })
    }
    </>
  )
}

export default Landing
